import React from "react";
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";

const Header = () => {
    return(
          <div className=" w-14 h-14 bg-green-600 border rounded-sm">
            <Router>
          <Link>Home</Link>
          <Link>About</Link>
          <Link>Our Services</Link>
          <Link>Branches</Link>
          <Link>Blog</Link>
          <Link>Contact</Link>
          </Router> 
           </div>
    )

}

export default Header;
